static void
cadd_coll(Coll **cpp, char *text)
{
	if (!*cpp)
        	*cpp = new_Coll(0,0);
	append_Coll(*cpp, text);
}

static Coll *
clone_coll(Coll *cp)
{
	Coll *ret;
        int i;

	if (!cp)
        	return 0;

	ret = new_Coll(0, 0);
        for(i=0; i<cp->count; i++)
        	append_Coll(ret, cp->items[i]);

	return ret;
}

static void
get_list_delim(Coll *coll, int beg, int is_opt, Coll **del)
{
	int j, hard=0;

	for(j=beg; !hard && j<coll->count; j++)
	{
		CommandPart *cpp=(CommandPart*)coll->items[j];

		switch(cpp->type)
		{
		case SM_word:
		case SM_literal:
                	if (!hard)
                        {
				cadd_coll(del, cpp->text);
                                hard++;
			}
			break;
		case SM_enum:
                	if (!hard)
                        {
                        	int i;
				for(i=0 ; i<cpp->option->count/*-1*/ ; i++)
					cadd_coll(del, cpp->option->items[i]);
                                hard++;
			}
                	break;
		case SM_option:
			get_list_delim(cpp->option, 0, 1, del);
			break;
		default:
                	break;
		}
	}

	/* only for options: collect all previous options delimiters */
        for( j=beg-1; is_opt && j>=0; j-- )
        {
		CommandPart *cpp=(CommandPart*)coll->items[j];

		switch(cpp->type)
		{
                default:
                	return;
		case SM_option:
			get_list_delim(cpp->option, 0, 1, del);
			break;
		}
        }

}

static void
set_last(Coll *coll)
{
	CommandPart *cp;
	if (!coll || !coll->count)
		return;

	cp=(CommandPart*)coll->items[coll->count-1];
	if (cp->type==SM_option)
		set_last(cp->option);
	else
		cp->isLast=1;
}

static void
set_list_delim(Coll *coll, Coll *delim, int is_opt)
{
	int i;
	for(i=0;i<coll->count;i++)
	{
		CommandPart *cp=(CommandPart*)coll->items[i];
		switch (cp->type)
		{
		case SM_option:
			{
				Coll *del = clone_coll(delim);
				CommandPart *cpp;
				get_list_delim(coll, i+1, 1, &del);
				set_list_delim(cp->option,del,1);
				cpp = (CommandPart*)cp->option->items[0];
				switch(cpp->type)
				{
				case SM_word:
				case SM_enum:
				case SM_literal:
					cp->isWord++;
					break;
				default:
					break;
				}
			}
			break;
		case SM_norm:
			{
				int j, hard=0;
				Coll *del=clone_coll(delim);
				for(j=i+1; !hard && j<coll->count;j++)
				{
					CommandPart *cpp=(CommandPart*)coll->items[j];
					switch (cpp->type)
					{
					case SM_word:
					case SM_literal:
                                        	cadd_coll(&del, cpp->text);
                                                hard++;
						break;
					case SM_option:
						get_list_delim(cpp->option, 0, 1, &del);
						break;
					default:
					}
				}
				cp->delim=del;
			}
			break;
		case SM_list:
			cp->delim=clone_coll(delim);
			break;
		default:
		}
	}
}

static void
reorder_list(Coll *coll)
{
	int i;
	int list_pos=-1;
	CommandPart *lp=0;

	for(i=0;i<coll->count;i++)
	{
		CommandPart *cp=(CommandPart*)coll->items[i];
		switch (cp->type)
		{
		case SM_option:
			{
				CommandPart *cp1;

				if (cp->option->count!=1)
					continue;
				cp1=(CommandPart*)cp->option->items[0];
				if (cp1->type != SM_list)
					continue;
				if (list_pos != -1)
					continue;
				list_pos = i;
				lp = cp;
			}
			break;
		default:
			return;
		}
	}

	if (list_pos!=-1)
	{
		atRemove_Coll(coll, list_pos);
		append_Coll(coll, lp);
	}

}

static void
finaleCommandList(void)
{
	reorder_list(curCommandList);
	set_list_delim(curCommandList, NULL,0);
}


static void
putOffs(int level)
{
	while (level)
	{
		putchar('\t');
		level--;
	}
}




