static CommandPart *
findPart(Command *cp, CommandPart *sp)
{
	int j;
	for(j=0; j<cp->patternIt.count;j++)
	{
		CommandPart *pp=(CommandPart*)cp->patternIt.items[j];
		if (!strcmp(sp->text, pp->text))
			return pp;
	}
	return NULL;
}

static void
check_Command(Command *cp)
{
	int i;

	for(i=0; i<cp->substIt.count;i++)
	{
		CommandPart *sp=(CommandPart*)cp->substIt.items[i];
		if (sp->type == TM_join)
			continue;
		if (!findPart(cp, sp))
			yyerror("no subst marker '%s' in pattern part of command", sp->text);

	}
}

static void
skip_space(int *pos)
{
	for(;;)
		switch(yytext[*pos])
		{
		case ' ':
		case '\t':
		case '\r':
		case '\n':
			++(*pos);
			break;
		default:
			return;
		}
}

static void
skip_to_space(int *pos, char *initial, int ilen)
{
	int i;

	for(i=0; i<ilen; i++)
        {
        	if (yytext[*pos] != initial[i])
                	break;
        	++(*pos);
        }

	for(;;)
		switch(yytext[*pos])
		{
		case ' ':
		case '\t':
		case '\r':
		case '\n':
		case 0:
			return;
		default:
			++(*pos);
			break;
		}
}

static void skip_string(int *pos, int quota);

static void
skip_brack(int *pos, int l, int r, int first)
{
	int level=1, c;

	for ( ; *pos< yyleng ; ++(*pos) )
	{
		c = yytext[*pos];
		if (!first || l!='[')
		{
		if (c=='"')
		{
			++(*pos);
			skip_string(pos, c);
			continue;
		}
		if (c=='\'')
		{
			++(*pos);
			skip_string(pos, c);
			continue;
		}
		}
		if (c==l)
		{
			level++;
			continue;
		}
		if (c==r)
		{
			level--;
			if (level<1)
				return;
			continue;
		}
                if (c=='\n'||c=='\r')
                {
                	(*pos)--;
                	return;
		}
	}
	if (*pos==yyleng)
		yyerror("unmatched bracket '%c' ", l);
}

static void
skip_string(int *pos, int quota)
{
	while ( *pos< yyleng && (yytext[*pos]!=quota ||
		(*pos>2 && yytext[(*pos)-1]=='\\' && yytext[(*pos)-2]=='&') ) )
	{
        	if ( yytext[(*pos)+1] == '\n' )
                	return;
		++(*pos);
	}
}

static int
is_gr(int ch)
{
	if (isalnum(ch))
		return 1;
	switch(ch)
	{
	case '"':
	case '\'':
	/*case '.':*/
	case '_':
	case '(':
	case ')':
	case '[':
	case ']':
	case '&':
		return 1;
	}
	return 0;
}

static int
is_id(int ch)
{
	if (isalnum(ch)||ch=='_')
		return 1;
	return 0;
}

static int
is_ident(char *s)
{
	if (!isalpha(*s) && *s!='_')
		return 0;
	for(++s; *s; ++s)
		if (!is_id(*s))
			return 0;
	return 1;
}

static int
is_op(int ch)
{
	switch(ch)
	{
	case '.':
        case ':':
	case '!':
	case '<':
	case '>':
	case '=':
	case '#':
	case '-':
	case '+':
	case '*':
	case '/':
	case '%':
	case '^':
	case '$':
		return 1;
	}
	return 0;
}

static int
is_lconst(int plch)
{
	switch(plch)
	{
	case 'f':
	case 'F':
	case 'n':
	case 'N':
	case 't':
	case 'T':
	case 'y':
	case 'Y':
		return 1;
	}
	return 0;
}

static int
is_pat(int ch)
{
	if (ch=='.' || ch=='*' || ch=='?')
        	return 1;
	else
        	return 0;
}

static int
is_expr(int plch, int lch, int rch, int nch, int pplch, int nnch)
{
	if ( lch == '.' && is_lconst(plch) && pplch=='.' && is_gr(rch) )
		return 0;
	if ( rch == '.' && toupper(lch)=='M' && !is_id(plch))
        	return 1;
	if ( rch == '.' && is_lconst(nch) && nnch=='.' && is_id(lch) )
		return 0;
	if ( is_pat(lch) && is_pat(rch))
        	return 1;
	if ( (is_op(lch) && (is_gr(rch)||rch==':'))
		|| (is_id(lch) && (rch=='('||rch=='['))
                || (lch==':' && (rch==':'||rch=='='))
		|| (lch=='.' && rch=='.'  )
		|| (lch=='-' && rch=='>'  )
		|| (lch=='<' && rch=='>'  )
		|| (rch=='=' && (lch=='='||lch=='-'||lch=='+'||lch=='*'||lch=='/'||lch=='^'||lch=='<'||lch=='>'||lch=='!')  )
		|| (is_op(lch) && (rch=='!'||rch=='.'||rch=='-'||rch=='+'||rch=='{'))
		|| ((lch==')'||lch=='}'||is_gr(lch)) && is_op(rch))
		)
		return 1;
	return 0;
}

static int
delim_char(Coll *delims, int ch, int pos)
{
	int i;

	if (!delims)
        	return 0;

	for(i=0; i<delims->count; i++)
        {
                char *s = (char*) delims->items[i];
#if 1
        	if (s[0]==ch)
                {
                	int l = strlen(s);
                        int yl = yyleng-pos;
                        if (l<=yl && !memcmp(s, yytext+pos, l))
                        	return 1;
                }
#else
        	if (s[1]==0 && s[0]==ch)
        		return 1;
#endif
        }

	return 0;
}

static void
skip_norm(int *pos,int extend, Coll *delims)
{
	int done;
	int plastch=0, lastch=0, ch, first=1, nch, bch, b, pplastch=0, nnch;
	for(done=0; *pos<yyleng ; ++(*pos))
	{
		bch = ch = yytext[*pos];
		b = *pos;
		switch(ch)
		{
		case '(': /* ) */
                	if (delim_char(delims, ch, *pos))
                        	return;
			++(*pos);
			skip_brack(pos,'(',')',first);
			ch=')';
			break;
		case '{': /* } */
                	if (delim_char(delims, ch, *pos))
                        	return;
			++(*pos);
			skip_brack(pos,'{','}',first);
			ch='}';
			break;
		case '[': /* ] */
                	if (delim_char(delims, ch, *pos))
                        	return;
			++(*pos);
			skip_brack(pos,'[',']',first);
			ch=']';
			break;
		case '"':
		case '\'':
			++(*pos);
			skip_string(pos, yytext[*pos-1]);
			break;
		case ' ':
		case '\t':
				while( *pos<yyleng && ( yytext[*pos]==' ' || yytext[*pos]=='\t' ) )
					++(*pos);

                case ':':
                case '=':
                case '+':
                case '-':
                case '.':
                case '*':
                case '/':
                case '<':
                case '>':
                case '%':
                case '$':
                case '&':
                case '|':
			{
				if (first && (*pos<(yyleng-2)) && yytext[*pos]==':' && yytext[(*pos)+1]=='=')
                                {
                                	return;
                                }

                        	if ( extend && (ch=='.'||ch=='/'||ch==':'||ch=='&') )
                        		break;
				if (lastch==']' && yytext[*pos]=='[')
                                	continue;
				if (delims)
				{
                                	int j;
                                        int beg = *pos;
                                        char *s = yytext+beg;
                                	
                                	for(j=0; j<delims->count; j++)
                                        {
                                        int pl, len, found = 0;
                                        char *delim = (char*) delims->items[j];
                                        pl = strlen(delim);
                                        len = yyleng-beg;
                                        if (pl>len)
                                        	break;
					if (pl <= len && !strncasecmp(s, delim, pl))
					{
                                		if (len==pl || !isalnum(s[pl]) || !isalnum(delim[0]))
							found=1;
					}
                                	else if (pl>4) /* partial match! */
                                	{
                                		int pp = beg;
                                        	int l1;
                                        	skip_to_space(&pp,delim,pl);
                                        	l1 = pp-beg;
                                        	if (l1 >= 4 && !strncasecmp(s, delim, l1))
                                        	{
                                                	found = 1;
                                                	pl = l1;
                                                	break;
                                        	}
                                	}
                                        if (found)
					{
                                        	v_printf(4, "skip_norm: match delim '%s', return at '%s'\n",
                                                	delim, yytext+*pos);
						return;
					}
                                        }
				}

				ch = yytext[*pos];
				if (*pos < (yyleng-1))
					nch = yytext[*pos+1];
				else
					nch = 0;
				if (*pos < (yyleng-1))
					nnch = yytext[*pos+1];
				else
					nnch = 0;
				if ( *pos>0 && ( bch=='&' && is_id(yytext[*pos-1]) ))
                                {
                                }
				else if ( lastch && !is_expr(plastch, lastch, ch, nch, pplastch, nnch) )
				{
					*pos=b;
					return;
				}
                                if (bch==' '||bch=='\t')
                                {
					--(*pos);
					continue;
				}
			}
			break;
		case '\\':
		/*case '/':*/
			if (extend)
				break;
		case ',':
		case '\r':
		case '\n':
		case ')':
		case 0:
			done=1;
			break;
		}
                pplastch=plastch;
		plastch=lastch;
		lastch=ch;
		if (done)
			break;
		first=0;
	}
}

static int matchCommandPart(CommandPart *p, int *pos);


static int
matchCommandPartList(Coll *coll, int *pos, int top)
{
	int i, j, r, k;
	int count=coll->count;

	for(i=0; i<count;)
	{
		CommandPart *cp, *cpp;
		int beg, end;

		cp=(CommandPart*)coll->items[i];
		if (cp->type!=SM_option)
		{
			if (!matchCommandPart(cp, pos))
				return 0;
			++i;
			continue;
		}

		beg=i;
		for(j=i+1; j<count;j++)
		{
			cpp=(CommandPart*)coll->items[j];
			/*if ( cpp->type==SM_literal || cpp->type==SM_word )*/
			if (cpp->type!=SM_option)
				break;
		}
		end=j;

		if (end<count)
		{
			/* check first non-option arg */
			cpp=(CommandPart*)coll->items[end];
			if (
				(cpp->type==SM_literal||cpp->type==SM_word) &&
				matchCommandPart(cpp, pos) )
			{
				i=end+1;
				continue;
			}
		}
		for(k=beg; k<end;++k)
		{
			for(j=beg; j<end; ++j)
			{
				cpp=(CommandPart*)coll->items[j];
				if (cpp->isWord)
					r=matchCommandPart(cpp,pos);
				else
					continue;
				if (r)
					break;
			}
			if (j!=end)
			{
				skip_space(pos);
				continue;
			}
			for(j=beg; j<end; ++j)
			{
				cpp=(CommandPart*)coll->items[j];
				if (!cpp->isWord)
					r=matchCommandPart(cpp,pos);
				else
					continue;
				if (r)
					break;
			}
			if (j==end)
				break;
			skip_space(pos);
		}
		i = end;
	}


	return 1;
}

static char *
mem_Dup(const char *str, int len)
{
	char *r=(char*)malloc(len+1);
	int i;
	for( i=0; i<len; ++i)
		r[i]=toupper(str[i]);
	r[len]=0;
	return r;
}

static char *
mem_dup(const char *str, int len)
{
	char *r=(char*)malloc(len+1);
	memcpy(r, str, len);
	r[len]=0;
	return r;
}

