char *
quot_str(char *str, int simple)
{
	int lq = '"', rq = '"';
	int l, nq, r, n, i;
	char *s, *d, *e;

	l = strlen(str);
        e = str + l;
	r = choose_quot(str, &lq, &rq, simple);
	if (!r)
	{
		if (lq && rq)
		{
			s = (char*) malloc(l+3);
			memcpy(s+1, str, l);
			s[0] = lq;
			s[l+1] = rq;
			s[l+2] = 0;
			return s;
		}
		else
		{
			return strdup(str);
		}
	}

        e = str + l - 1;
	for(s=str, nq=0; *s; s++)
	{
		switch(*s)
		{
                case '&':
                	if (s[1]=='\\' && s+2 < e)
                        {
                        	s++;
                                s++;
                        }
                        break;
		case '\'':
		case '"':
		case '`':
		case '[':
		case ']':
			nq++;
			break;
		}
	}


	if ( l>1 && (str[0] == '"' || str[0]=='\'' || str[0]=='`' )
		&& str[l-1] == str[0] )
	{
		n = l-1;
		i = 1;
	}
	else
	{
		n = l;
		i = 0;
	}

	s = (char*) malloc(n + nq * 2 + 3);
	d = s;
	*d++ = '"';


	for( ; i<n; i++, d++)
	{
		switch(str[i])
		{
                case '&':
                	if (str[i+1]=='\\' && str+i+2 < e)
                        {
                        	*d++ = str[i];
                        	*d++ = str[i+1];
                                *d = str[i+2];
                                i += 2;
                                continue;
                        }
                        break;
		case '\'':
		case '"':
		case '`':
		case '[':
		case ']':
			*d++ = '&';
			*d++ = '\\';
			break;
		}
		*d = str[i];
	}
	*d++ = '"';
	*d++ = 0;

	return s;
}

int
choose_quot(char *str,int *lquot, int *rquot, int simple)
{
	char *s;
	int ch,n=0, l;
	l = strlen(str);

	if (l>1 && !simple)
	{
		if ( (str[0] == '"' && str[l-1] == '"' && !memchr(str+1, '"', l-2) )
			|| (str[0] == '\'' && str[l-1] == '\'' && !memchr(str+1, '\'', l-2))
			|| (str[0] == '[' && str[l-1] == ']' && !memchr(str+1, ']', l-2))
		   )
		{
			*lquot = *rquot = 0;
			return 0;
		}
	}

	do
	{
		int lq = *lquot;
		int rq = *rquot;

		for(s=str; (ch=*s); ++s)
			if (ch==lq || ch==rq)
				break;
		if (!ch)
			return 0;
		next_quot(lquot, rquot);
	}
	while (n++<3);

	return -1;
	/*yyerror("cannot choose quota characters for string '%s'", str);*/
}

static void
substCommandPartList(Coll *coll, int *beg, int reverse, int parno)
{
	int i, isExpr, cnt = 0, prev_type = 0;
	int Beg=*beg, end=*beg;

	for(i = 0; i<coll->count; i++)
	{
		CommandArg *ap;
		CommandPart *cp=(CommandPart*) coll->items[i];
		*beg=Beg;
		if (cnt)
		{
			if (cp->type != TM_join && prev_type != TM_join)
				put_char(' ');
		}
		else
		{
			cnt++;
		}

		prev_type = cp->type;

		switch(cp->type)
		{
		case TM_word   :
		case TM_literal:
			put_str(cp->text);
			break;
		case TM_norm   :
			ap=findArg(cp,beg,reverse,parno);
			if (!ap)
				break;
			if (ap->text)
				put_str(ap->text);
			else if (ap->list)
			{
				int i;
				for(i=0; i<ap->list->count ;i++)
				{
					if (i>0)
					{
						if (ap->listcomma)
							put_char(',');
						else
							put_char(' ');
					}
					put_str((char*)ap->list->items[i]);
				}
			}
			else if(ap->val)
				put_str(ap->val);
			break;
		case TM_noni   :
			ap=findArg(cp,beg,reverse,parno);
			if (!ap)
			{
				put_str("\"\"");
				break;
			}
			else if (ap->text)
			{
				put_str_free(quot_str(ap->text, 0));
			}
			else if (ap->list)
			{
				int i;
				put_char('"');
				for(i = 0; i < ap->list->count; i++)
				{
					if (i>0)
					{
						if (ap->listcomma)
							put_char(',');
						else
							put_char(' ');
					}
					put_str((char*)ap->list->items[i]);
				}
				put_char('"');
			}
			else if(ap->val)
			{
				put_str_free(quot_str(ap->val,0));
			}
			break;
		case TM_str    :
			{
			ap=findArg(cp,beg,reverse,parno);
			if (!ap)
				break;
			if (ap->text)
			{
                                int l = strlen(ap->text);
				if (ap->text[0]=='&' && is_ident(ap->text+1))
				{
					put_mem(ap->text+1, l-1);
				}
                                else if ( l>3 && ap->text[0]=='&'
                                	&&  ap->text[1]=='(' && ap->text[l-1]==')' )
				{
                                        put_mem(ap->text+2, l-3);
                                }
				else
				{
					put_str_free(quot_str(ap->text,1));
				}
			}
			else if (ap->list)
			{
				int i;
				for(i = 0; i < ap->list->count ;i++)
				{
					char *s = (char*)ap->list->items[i];
					if (i > 0)
					{
						if (ap->listcomma)
							put_char(',');
						else
							put_char(' ');
					}
					if (ap->rawlist && indexOf_Coll(ap->rawlist, s, 0))
						put_str(s);
					else
						put_str_free(quot_str(s,0));
				}
			}
			else if(ap->val)
			{
				if (ap->val[0]=='&' && is_ident(ap->val+1))
				{
					put_str(ap->val+1);
				}
				else
				{
					put_str_free(quot_str(ap->val,0));
				}
			}
			}
			break;
		case TM_intel  :
			ap=findArg(cp,beg,reverse,parno);
			if (!ap)
				break;
			vo_printf(4, 0, "TM_intel: %d %s\n", i, ap->text? ap->text:"LIST");
			if (ap->text)
			{
				int isMacro=0;
				char *s;

				if ( ap->text[0]=='(')
					isExpr=1;
				else if (ap->text[0]=='&')
					{
						if ( ap->text[1]=='(' ||  is_ident(ap->text+1) )
						{
							isExpr=1;
							isMacro=1;
						}
						else
							isExpr=0;
					}
				else
					isExpr=0;

				if (isMacro)
					s = ap->text+1;
				else
					s = ap->text;
				if (isExpr)
					put_str(s);
				else
					put_str_free(quot_str(s,0));

			}
			else if (ap->list)
			{
				int i;
				for(i = 0; i < ap->list->count ;i++)
				{
					char *text=(char*)ap->list->items[i];
					
					
					if (*text=='(')
						isExpr=1;
					else
						isExpr=0;
					
					if (i > 0)
					{
						if (ap->listcomma)
							put_char(',');
						else
							put_char(' ');
					}
					
					if (isExpr||!strcmp(text,","))
						put_str(text);
					else
						put_str_free(quot_str(text,0));

				}
			}
			else if(ap->val)
			{
				int isMacro=0;
				char *s;

				if ( ap->val[0]=='(')
					isExpr=1;
				else if (ap->val[0]=='&')
					{
						if ( ap->val[1]=='(' ||  is_ident(ap->val+1) )
						{
							isExpr=1;
							isMacro=1;
						}
						else
							isExpr=0;
					}
				else
					isExpr=0;

				if (isMacro)
					s = ap->val+1;
				else
					s = ap->val;
				if (isExpr)
					put_str(s);
				else
					put_str_free(quot_str(s,0));
			}
			break;
		case TM_block  :
			{
			int isBlock=0;
			ap=findArg(cp,beg,reverse,parno);
			if (!ap)
				break;
			if (ap->text)
			{
				if (ap->text[0]=='{')
					isBlock=1;
				else
					isBlock=0;
				if (!isBlock)
					put_str("{||");
				put_str(ap->text);
				if (!isBlock)
					put_char('}');
			}
			else if (ap->list)
			{
				int i;
				for(i=ap->list->count-1; i>=0 ;i--)
				{
					char *text = (char*)ap->list->items[i];
					if (!strcmp(text, ","))
					{
						put_char(',');
						continue;
					}
					if (i>0)
					{
						if (ap->listcomma)
							put_char(',');
						else
							put_char(' ');
					}
					if (text[0]=='{')
						isBlock=1;
					else
						isBlock=0;
					if (!isBlock)
						put_str("{||");
					put_str(text);
					if (!isBlock)
						put_char('}');
				}
			}
			else if(ap->val)
			{
				if (ap->val[0]=='{')
					isBlock=1;
				else
					isBlock=0;
				if (!isBlock)
					put_str("{||");
				put_str(ap->val);
				if (!isBlock)
					put_char('}');
			}
			else
				put_str("{||.F.}");
			}
			break;
		case TM_log    :
			ap=findArg(cp,beg,reverse,parno);
			if (ap && (ap->text || (ap->list && ap->list->count) || ap->val))
				put_str(".T.");
			else
				put_str(".F.");
			break;
		case TM_var    :
			ap=findArg(cp,beg,reverse,parno);
			if (ap)
			{
				char name[128];
				snprintf(name, sizeof(name), "_%s_%d", cp->text, parno);
				put_str(name);
			}
			break;
		case TM_join:
			break;
		case TM_option :
			{
			int jj;
			for(jj=0;jj<64;jj++)
			{
				int b=0;
				if (jj)
				{
					if (testAllDefs(cp->option,b,jj))
					{
						vo_printf(4, 0, "TM_option: %d %d %d\n", i, b, jj);
						substCommandPartList(cp->option,&b,0,jj);
					}
					else
						break;
				}
				else
				{
                                	int kk, bb=b;
					for(kk=0; testAllDefs(cp->option,b,jj); kk++)
					{
						vo_printf(4, 0, "TM_option: %d %d %d\n", i, b, jj);
						substCommandPartList(cp->option,&b,0,jj);
                                                if (kk>64 && b==bb)
                                                {
                                                	yyerror("endless subst loop detected");
                                                	break;
                                                }
					}
				}
			}
			if (jj==64)
				yywarning("too many entries in OPTIONAL list: > %d\n", jj);
			}
			break;
		default:
		}
		if (*beg>end)
			end=*beg;
	}
	*beg=end;
}

static void
substCurCommand(int nl)
{
	int beg=0;
        vo_printf(4, 0, "substCurCommand: %s\n", curCommand->name);
	substCommandPartList(&curCommand->subst,&beg,0,0);

	if (nl)
		put_char('\n');
	else
		put_char(' ');

}


