static int
is_preproc_str(char *ibuf, int result)
{
	int i;
	for(i=0; i<result; i++)
       	{
               	int ch = ibuf[i];
                if (ch==' '||ch=='\t')
                       	continue;
       		else if (ch=='#')
                	return 1;
		else
                       	return 0;
       	}
        return 0;
}

static int
is_empty_str(char *ibuf, int result)
{
	int i;
	for(i=0; i<result; i++)
       	{
               	int ch = ibuf[i];
                if (ch==' ' || ch=='\t' || ch=='\r' || ch=='\n')
                       	continue;
		else
                       	return 0;
       	}
        return 1;
}

static int
get_input_str(char **ibuf, int *max_size)
{
	char *str;
        int result = 0;

	if (unput_buffer.ptr > unput_buffer.buf)
        {
        	int l;
                l = unput_buffer.ptr - unput_buffer.buf;
                if (l >= *max_size)
                {
                	*ibuf = (char *) realloc(*ibuf, l+1);
                        *max_size = l+1;
		}
                memcpy(*ibuf, unput_buffer.buf, l);
                unput_buffer.ptr = unput_buffer.buf;
                result = l;
		if (subst_flag==1)
			subst_flag = 2;
        	else
                	subst_flag = 0;
        }
        else if (unput_strings.count)
        {
        	int ind, l;
        	StrBuf *sp;

		ind = unput_strings.count - 1;
        	sp = (StrBuf*) unput_strings.items[ind];
                
                l = sp->ptr - sp->buf;
                if (l >= *max_size)
                {
                	*ibuf = (char *) realloc(*ibuf, l+1);
                        *max_size = l+1;
		}
                memcpy(*ibuf, sp->buf, l);
		result = l;
		
                atFree_Coll(&unput_strings, ind);
		subst_flag = 1;
                subst_count = 1;
        }
        else
        {
		str = fgets(*ibuf, *max_size - 1, yyin);
		if (!str)
		{
			if (ferror(yyin))
				YY_FATAL_ERROR( "input in flex scanner failed" );
			result = YY_NULL;
		}
		else
		{
                	int l = strlen(str);
			memcpy(*ibuf, str, l);
			result = l;
		}
		subst_flag = 1;
                subst_count = 1;
        }
	
	if (result > 0)
        {
		if ((*ibuf)[result - 1] != '\n')
		{
			(*ibuf)[result] = '\n';
			result++;
			(*ibuf)[result] = 0;
		}
		if (is_empty_str( *ibuf, result ))
        	{
        		(*ibuf)[0] = '\n';
                	(*ibuf)[1] = 0;
                	return 1;
        	}
        }
        else
        	subst_flag = 0;


	return result;
}


static int
split_input_str(char *buf, int size)
{
	int count;
        int ins_ind = unput_strings.count;

	for(count = 0 ; size > 0 ; count++)
        {
        	StrBuf *sp;
        	char *b;
                int l;

        	b = (char*) memchr(buf, '\000', size);
                if (!b)
                {
                	if (!count)
                		return 0;
			else
                        	l = size;
		}
                else
			l = b + 1 - buf;

		sp = new_StrBuf();
		write_StrBuf(sp, buf, l-1);
               	putByte_StrBuf(sp, '\n');
		/*atInsert_Coll(&unput_strings, sp, 0);*/
		atInsert_Coll(&unput_strings, sp, ins_ind);
                if (b)
                {
                	clic_line--;
                	all_lines--;
                }
                
                buf += l;
                size -= l;
	}

	return count;
}

typedef enum
{
	PP_Normal,
	PP_Bracket,
        PP_Quote1,
        PP_Quote2,
        PP_Quote3,
        PP_Comment,
}
PP_State;

typedef struct
{
	PP_State pstate;
        PP_State rstate;
        char **obuf;
        int opos;
        int *olen;
        int brack_level;
        int comment_level;
        int pch;
}
P_State;

#define ISNAME( c )  ( isalnum( ( int ) c ) || ( c ) == '_' || ( c ) > 0x7E )

static void
addch_pp(P_State *pp, int ch)
{
	if(pp->opos >= (*pp->olen))
        {
        	(*pp->olen) *= 2;
                (*pp->obuf) = (char *) realloc(*pp->obuf, *pp->olen);
        }

	(*pp->obuf)[pp->opos]=ch;
	(pp->opos)++;
}

/* return not 0 in need more strings */
static int
process_input_str(char *ibuf, int ilen, P_State *pp)
{
	int ch, i, space = 1;
        int do_comment = 0;
        int is_preproc = 0;
        int prev_opos = pp->opos;

	if ( is_preproc_str(ibuf, ilen)||is_preproc_str(*pp->obuf, pp->opos) )
        {
		is_preproc = 1;
	}
	if (pp->pstate != PP_Comment && is_preproc)
        {
		do_comment = 1;
	}
        
	for(i=0; i<ilen; i++)
        {
        	ch = ibuf[i];

        	switch(pp->pstate)
                {
                case PP_Normal:
                case PP_Bracket:
                	switch(ch)
                        {
			case '[':              /* { */
                        	/*if (do_comment)
                                	break;*/
				/*if (is_preproc)
                                	break;*/
                        	if (pp->pstate == PP_Bracket)
                                	pp->brack_level++;
				else if( !do_comment && (ISNAME(pp->pch) || strchr( ")]}.", pp->pch )) )
                                {
                                	pp->rstate = pp->pstate;
					pp->pstate = PP_Bracket;
                                        pp->brack_level = 1;
				}
				else
                                {
                                	pp->rstate = pp->pstate;
					pp->pstate = PP_Quote3;
				}
				break;

                	case ']':
                        	/*if (do_comment)
                                	break;*/
				/*if (is_preproc)
                                	break;*/
                        	if (pp->pstate == PP_Bracket)
                                {
                        		pp->brack_level--;
                        		if (pp->brack_level == 0)
                                	{
                                		pp->pstate = pp->rstate;
					}
                                }
                		break;

                        case '\"':
                        	/*if (do_comment)
                                	break;*/
				/*if (is_preproc)
                                	break;*/
                                pp->rstate = pp->pstate;
                        	pp->pstate = PP_Quote1;
                                break;

                        case '\'':
                        	/*if (do_comment)
                                	break;*/
				/*if (is_preproc)
                                	break;*/
                                pp->rstate = pp->pstate;
                        	pp->pstate = PP_Quote2;
                                break;

                        case '/':
                        	if ((pp->opos)>0 && (*pp->obuf)[(pp->opos)-1] == '/')
                                {
                                	--(pp->opos);
                                        addch_pp(pp,'\n');
                                        goto ret;
                                }
                                break;

                        case '&':
                        	if ((pp->opos)>0 && (*pp->obuf)[(pp->opos)-1] == '&')
                                {
                                	--(pp->opos);
                                        addch_pp(pp,'\n');
                                        goto ret;
                                }
                                break;

                        case '*':
                                if (space)
                                {
                                        if (prev_opos)
                                        	break;
                                	if (ilen>8 && !strncmp(ibuf, "*charset", 8))
                                        	break;
                                	if (ilen>10 && !strncmp(ibuf, "*reference", 10))
                                        	break;
                                	if (ilen>7 && !strncmp(ibuf, "*cmdstr", 7))
                                        	break;
                                        addch_pp(pp,'\n');
                                	goto ret;
                                }
                        	if ((pp->opos)>0 && (*pp->obuf)[(pp->opos)-1] == '/')
                                {
                                	pp->rstate = pp->pstate;
                                	pp->comment_level = 1;
                                        pp->pstate = PP_Comment;
                                        pp->pch = 0;
                                        space = 0;
                                        (pp->opos)--;
                                        continue;
                                }
                                break;

                        case ';': /* Split line later!!! */
                        	if (do_comment)
                                	break;

                        	addch_pp(pp,'\000');
                        	continue;

                        default:
                                break;
                        }

                        if (ch != ' ' && ch != '\t')
                        	pp->pch = ch;
                        break;
                
                
                case PP_Quote1:
                	if (ch == '\"')
                        {
                        	pp->pstate = pp->rstate;
                		pp->pch = ch;
                        }
                	break;
                
                case PP_Quote2:
                	if (ch == '\'')
                        {
                        	pp->pstate = pp->rstate;
                		pp->pch = ch;
                	}
                	break;
                
                case PP_Quote3:
                	if (ch == ']')
                        {
                        	pp->pstate = pp->rstate;
                		pp->pch = ch;
                	}
                	break;
                
                case PP_Comment:
                	if (pp->pch == '/' && ch == '*')
                        	pp->comment_level++;
                        else if (pp->pch == '*' && ch == '/')
                        	pp->comment_level--;
                	
                	if (pp->comment_level == 0)
                        	pp->pstate = pp->rstate;
                	
                	pp->pch = ch;
                        continue;
                }
                
                if (space && ch != ' ' && ch!= '\t')
                        space = 0;

                addch_pp(pp,ch);
	}

      ret:
	switch(pp->pstate)
        {
        case PP_Comment:
        	return 1;
        case PP_Quote1:
        case PP_Quote2:
        case PP_Quote3:
        	if (is_preproc)
        		pp->pstate = PP_Normal;
		/*else
                	return 1;*/
	default:
        	break;
        }

	for(i = pp->opos-1; i >= 0; i--)
        {
        	switch((*pp->obuf)[i])
                {
                case ' ':
                case '\t':
                case '\r':
                case '\n':
                	continue;
                case '\000':
                        (*pp->obuf)[i] = ' ';
                	pp->opos = i+1;
                        return 1;
                case ';':
                	if (do_comment)
                        {
                        	(*pp->obuf)[i] = ' ';
                		pp->opos = i+1;
                        	return 1;
                        }
                default:
                	break;
                }
                break;
        }

	return 0;
}

/*#define PP_READ_SIZE (YY_READ_BUF_SIZE*8)*/
#define PP_READ_SIZE 4096

static int
do_input(char *buf, int max_size)
{
        static char *ibuf = 0;
        static char *obuf = 0;
        static int ilen = 0, olen = 0;
        static int subst_state=0;
        
        int r = 0;
        P_State pstate;
        

	if (!ibuf)
	{
        	ilen = PP_READ_SIZE;
        	ibuf = (char*) malloc(ilen);
        	olen = PP_READ_SIZE;
        	obuf = (char*) malloc(olen);
        }

	pstate.obuf = &obuf;
	pstate.olen = &olen;
	pstate.opos = 0;
	pstate.pstate = pstate.rstate = PP_Normal;
        pstate.pch = 0;

	if (!subst_flag)
        	subst_state = YYSTATE;

	for(;;)
        {
		r = get_input_str(&ibuf, &ilen);
                if (r <= 0 )
                	break;

		if ( process_input_str(ibuf, r, &pstate) )
                {
			clic_line++;
			all_lines++;
                        continue;
                }
                
		if ( split_input_str(*pstate.obuf, pstate.opos) )
                {
                	pstate.pstate = PP_Normal;
                	pstate.rstate = PP_Normal;
                        pstate.opos = 0;
        		pstate.pch = 0;
                	continue;
		}

                break;
	}

	if (r>=0)
        {
		memcpy(buf, *pstate.obuf, pstate.opos);
                r = pstate.opos;
                if (is_preproc_str(buf, r))
                {
                	subst_flag = 0;
                        subst_count = 0;
		}
	}

	if (subst_count)
		subst_flag = 1;
	else if (subst_flag == 1)
        	subst_flag = 2;

	if (YYSTATE == skipState)
        	subst_flag = 0;

	subst_count = 0;

	if (preproc_flag)
        {
        	int ind = -1, line = 0;
        	char *file;
                get_include(&ind, &line, &file);
		vo_printf(3,0, "do_input: %d: subst_flag=%d: %d: '%.*s'\n", clic_line, subst_flag, r, r, buf);
		vo_printf(4,0, "state: %d at: file %s line %d\n", subst_state, file, line);
	}

	if (!subst_flag)
        {
        	switch (YYSTATE)
                {
                case skipState:
                default:
        		BEGIN(subst_state);
                        break;
		case field_words:
		case for_words:
		case recover_words:
		case foreach_words:
		case field:
		case vardef_words:
		case static_words:
                	BEGIN(INITIAL);
                        break;
                }
                yy_set_bol(1);
		clic_pos=1;
		clic_word=0;
	}

	return r;
}

static void
put_buf(void)
{
	put_str( string_buf );
}

static void
put_char(int ch)
{
	subst_count++;
	if (ch=='\n')
	{
        	StrBuf *sp;
                if (unput_buffer.ptr > unput_buffer.buf && unput_buffer.ptr[-1] == '\n')
                {
			sp = calloc(sizeof(StrBuf), 1);
                	memcpy(sp, &unput_buffer, sizeof(StrBuf));
			memset(&unput_buffer, 0, sizeof(StrBuf));
                        append_Coll(&unput_strings, sp);
                }
	}
	
	if (ch)
		putByte_StrBuf(&unput_buffer, ch);
}

static void
put_str(const char *str)
{
	int l=strlen(str);
        put_mem(str, l);
}

static void
unputstr(const char *str)
{
	int l=strlen(str);
        unputmem(str, l);
}

static void
unputmem(const char *str, int l)
{
	const char *s = str+l-1;
	for(; s >= str; --s)
		unput(*s);
}


static void
put_mem(const char *str, int l)
{
	const char *s = str+l;
	for(; str < s; ++str)
		put_char(*str);
}

static void
put_str_free(char *str)
{
	put_str(str);
	free(str);
}

