static int
back_strsize(void *s1, void *s2)
{
	int l1 = strlen((char *)s1);	
	int l2 = strlen((char *)s2);
        int r = l2-l1;
	
	if (r)
        	return r;
	else
        	return strcasecmp((char*)s1, (char*)s2);
}

